import React from 'react'

const Comments = ({comments}) => {
  console.log(comments)
  const list = comments.map((comment) =>
    <div key={comment.id}>
      <h2>{comment.name}</h2>
      <p>{comment.body}</p>
    </div>
  );

  return (
    <div className="comments">
      {list}
    </div>
  )
}

export default Comments
